        <div style={{width:'70%',display:'block'}}>
            <div className='profile_wrapper'>
                <Component1 className='each_prof' key='a'/>
                <Component1 className='each_prof' key='b'/>
                <Component1 className='each_prof' key='b'/>
            </div>
        </div>
    )
}
export default AboutUs;
